static int32_t AcdbDataGetGlobalTblLookupKey (AcdbDataGlbTblLookupKeyType *pCmd,
                                                AcdbDataLookupKeyType *pRsp)
{
   int32_t result = ACDB_SUCCESS;
   if (pCmd == NULL || pRsp == NULL)
   {
      result = ACDB_BADPARM;
   }
   else
   {
      int32_t i = 0;
      result = ACDB_PARMNOTFOUND;
      for (; i < SIZE_OF_ARRAY (AcdbDataGlbTblTopology); ++i)
      {
         if (0 == memcmp (pCmd, &AcdbDataGlbTblTopology[i], sizeof (AcdbDataGlbTblLookupKeyType)))
         {
            pRsp->nLookupKey = AcdbDataGlobalTable[i].ulTableKey;
            result = ACDB_SUCCESS;
            break;
         }
      }
   }
   return result;
}

