static int32_t AcdbDataGetTableSize (AcdbDataGetTblSizeCmdType *pCmd,
                                     AcdbDataGetTblSizeRspType *pRsp
                                     )
{
   int32_t result = ACDB_SUCCESS;

   if (pRsp == NULL)
   {
      result = ACDB_BADPARM;
   }
   else
   {
      switch (pCmd->nParamId)
      {
      case ACDBDATA_PID_VOCPROC_COMMON_TABLE:
         pRsp->nEntries = (uint32_t)SIZE_OF_ARRAY(AcdbDataVocProcLookUp);
         break;

      case ACDBDATA_PID_VOCPROC_STREAM_TABLE:
         pRsp->nEntries = (uint32_t)SIZE_OF_ARRAY(AcdbDataVocStrmLookUp);
         break;
      
      case ACDBDATA_PID_VOCPROC_VOLUME_TABLE:
         {
            if (SIZE_OF_ARRAY(AcdbDataVocProcVolLookUp)%ACDB_NUMBER_OF_VOCPROC_VOL_STEP == 0)
            {
               pRsp->nEntries = (uint32_t)SIZE_OF_ARRAY(AcdbDataVocProcVolLookUp)
                                 /ACDB_NUMBER_OF_VOCPROC_VOL_STEP;
            }
            else
            {
               result = ACDB_BADSTATE;
            }
         }
         break;
      
      case ACDBDATA_PID_AUDPROC_COMMON_TABLE:
         pRsp->nEntries = (uint32_t)SIZE_OF_ARRAY(AcdbDataAudProcLookUp);
         break;
      
      case ACDBDATA_PID_AUDPROC_STREAM_TABLE:
         pRsp->nEntries = (uint32_t)SIZE_OF_ARRAY(AcdbDataAudStrmLookUp);
         break;
      
      case ACDBDATA_PID_AUDPROC_VOLUME_TABLE:
         {
            if (SIZE_OF_ARRAY(AcdbDataAudProcVolLookUp)%ACDB_NUMBER_OF_AUDPROC_VOL_STEP == 0)
            {
               pRsp->nEntries = (uint32_t)SIZE_OF_ARRAY(AcdbDataAudProcVolLookUp)
                                 /ACDB_NUMBER_OF_AUDPROC_VOL_STEP;
            }
            else
            {
               result = ACDB_BADSTATE;
            }
            break;
         }
      
      case ACDBDATA_PID_ADIE_PROFILE_TABLE:
         break;
      
      case ACDBDATA_PID_ANC_CONFIG_DATA_TABLE:
         pRsp->nEntries = (uint32_t)SIZE_OF_ARRAY(AcdbDataAdieANCDataLookUp);
         break;
      
      case ACDBDATA_PID_AFE_COMMON_TABLE:
		  pRsp->nEntries = (uint32_t)SIZE_OF_ARRAY(AcdbDataAFECmnLookup);
         break;
      
      default:
         result = ACDB_BADPARM;
         break;
      }
   }

   return result;
}

